/** @format */

import React, { Fragment, useState } from "react";
import { Box, Typography, Grid, TextField } from "@mui/material";

const CreateInvoice = () => {
  const [matterData, setMatterData] = useState({
    matter: "",
    contact: "",
    billable: false,
    date_range: "",
    create_date: "",
    due_date: "",
    template: "",
    invoice_no: "",
    discount: "",
    submit,
  });

  const {
    matter,
    contact,
    billable,
    date_range,
    create_date,
    due_date,
    template,
    invoice_no,
    discount,
  } = matterData;

  const onChange = (e) =>
    setMatterData({ ...matterData, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <Fragment>
      <Box
        component="form"
        Validate
        sx={{
          "& .MuiTextField-root": { m: 1 },
        }}
        onSubmit={(e) => onSubmit(e)}
      >
        <Typography component="h3" variant="h4">
          Create New Matter
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={8}>
            <TextField
              margin="normal"
              variant="standard"
              name="contact"
              label="contact"
              type="text"
              value="contact"
              onChange={(e) => onChange(e)}
              id="contact"
              autoComplete="contact"
              sx={{
                width: "97%",
              }}
            />
            <TextField
              margin="normal"
              variant="standard"
              name="matter_number"
              label="matter_number"
              type="text"
              value="matter_number"
              onChange={(e) => onChange(e)}
              id="matter_number"
              autoComplete="matter_number"
              disabled
              sx={{
                width: "48%",
              }}
            />
          </Grid>
        </Grid>
      </Box>
    </Fragment>
  );
};

export default CreateInvoice;
